import{_ as e,o,c as n,O as t}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 8.01-602 Proceedings when owner of money under control of court unknown.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/8.01-602.md","filePath":"vacode/8.01-602.md"}'),r={name:"vacode/8.01-602.md"},a=t('<h1 id="§-8-01-602-proceedings-when-owner-of-money-under-control-of-court-unknown" tabindex="-1">§ 8.01-602 Proceedings when owner of money under control of court unknown. <a class="header-anchor" href="#§-8-01-602-proceedings-when-owner-of-money-under-control-of-court-unknown" aria-label="Permalink to &quot;§ 8.01-602 Proceedings when owner of money under control of court unknown.&quot;">​</a></h1><p>Whenever any money has remained payable or distributable for one year in the custody or under the control of any court of this Commonwealth without anyone known to the court claiming the same, except funds deposited as compensation and damages in condemnation proceedings pursuant to § <a href="/vacode/25.1-237/">25.1-237</a> pending a final order or pursuant to § <a href="/vacode/33.2-1019/">33.2-1019</a>, the court shall cause such money to be reported and then remitted to the State Treasurer pursuant to §§ <a href="/vacode/55.1-2518/">55.1-2518</a> and <a href="/vacode/55.1-2524/">55.1-2524</a>.</p><p>The general receiver, if one has been appointed, and the clerk of the circuit court shall be responsible for identifying such money held by them in their respective control pursuant to §§ <a href="/vacode/8.01-582/">8.01-582</a> and <a href="/vacode/8.01-600/">8.01-600</a> and for petitioning the court to remit as provided in this section.</p><p>Code 1950, § 8-746; 1966, c. 210; 1977, c. 617; 1982, c. 155; 1984, c. 121; 1987, c. 708; 1988, c. 841.</p>',4),c=[a];function d(i,s,h,u,p,f){return o(),n("div",null,c)}const _=e(r,[["render",d]]);export{m as __pageData,_ as default};
